import React from 'react'
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import { styled } from '@mui/material/styles';
import {
  DataGrid,
  GridToolbarQuickFilter,
  GridLinkOperator,
} from '@mui/x-data-grid';
import Container from '@mui/material/Container';
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';



const ButtonEdit = styled(Button)(({ theme }) => ({
  color: theme.palette.getContrastText('#ffffff'),
  backgroundColor: "#ffffff",
  borderColor:'#ffee58',
  fontWeight: 'bold',
  '&:hover': {
    backgroundColor: "#ffee58",
    borderColor:'#ffee58',
  },
}));

const ButtonDelete = styled(Button)(({ theme }) => ({
  color: theme.palette.getContrastText('#ffffff'),
  backgroundColor: "#ffffff",
  borderColor:'#f44336',
  fontWeight: 'bold',
  '&:hover': {
    backgroundColor: "#f44336",
    borderColor:'#f44336',
    color:"#ffffff"
  },
}));

const columns = [
    { field: 'id', headerName: 'ลำดับ', width: 90 },
    {
      field: 'parcelnumber',
      headerName: 'เลขพัสดุ',
      width: 150,
      editable: true,
    },
    {
      field: 'parcelname',
      headerName: 'ชื่อพัสดุ',
      width: 150,
      editable: true,
    },
    {
      field: 'quantity',
      headerName: 'จำนวน',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
        field: 'unit',
        headerName: 'หน่วย',
        width: 150,
        editable: true,
      },
      {
        field: 'status',
        headerName: 'สถานะ',
        width: 150,
        editable: true,
      },
      {
        field: 'withdraw',
        headerName: 'เบิก',
        width: 150,
        editable: true,
      },
      {
        field: 'management',
        headerName: 'การจัดการ',
        width: 250,
        renderCell: (params) => (
          <strong>
            <Link to="#" style={{ textDecoration: "none" }}>
              <ButtonEdit
                variant="outlined"
                color="primary"
                size="small"
                style={{ marginLeft: 16 }}
                startIcon={<EditIcon />}
              >
                EDIT
              </ButtonEdit>
            </Link>
            <Link to="#" style={{ textDecoration: "none" }}>
              <ButtonDelete
                variant="outlined"
                color="primary"
                size="small"
                style={{ marginLeft: 16 }}
                startIcon={<DeleteIcon />}
              >
                DELETE
              </ButtonDelete>
            </Link>
          </strong>
        ),
      },
  ];
  
  const rows = [
    { id: 1, parcelnumber: '001', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 2, parcelnumber: '002', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 3, parcelnumber: '003', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 4, parcelnumber: '004', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 5, parcelnumber: '005', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 6, parcelnumber: '006', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 7, parcelnumber: '007', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 8, parcelnumber: '008', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
    { id: 9, parcelnumber: '009', parcelname: 'ปากกา', quantity: 12 ,unit:"EA"},
  ];


const DrawerHeader = styled('div')(({ theme }) => ({
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'flex-end',
    padding: theme.spacing(0, 1),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
  }));

  function QuickSearchToolbar() {
    return (
      <Box
        sx={{
          p: 0.5,
          pb: 0,
        }}
      >
        <GridToolbarQuickFilter
          quickFilterParser={(searchInput) =>
            searchInput
              .split(',')
              .map((value) => value.trim())
              .filter((value) => value !== '')
          }
        />
      </Box>
    );
  }

function PageParcelList() {
  return (
    <div>
        <Box sx={{width: "100%",height: "100%"}}>
        <DrawerHeader />

            <Box sx={{textAlign: "center"}}>
            <Typography
              variant="subtitle1"
              sx={{ color: "#ffffff", fontWeight: "bold", fontSize: "28px" }}
            >
              รายการพัสดุ
            </Typography>
            </Box>
            <DrawerHeader />
            <Container >
            <Box sx={{ height: 400, width: 1 ,backgroundColor:'#ffffff'}}>
      <DataGrid
         rows={rows}
        columns={columns}
        initialState={{
          filter: {
            filterModel: {
              items: [],
              quickFilterLogicOperator: GridLinkOperator.Or,
            },
          },
        }}
        components={{ Toolbar: QuickSearchToolbar }}
      />
    </Box>
    </Container>
        </Box>
    </div>
  )
}

export default PageParcelList
